import React, { useState } from 'react'
import './Navbar.css'

function Navbar() {

    const changeTitle = () => {
        switch(window.location.pathname){
            case '/new-order':
                return 'New';
            case '/incoming':
                return 'Incoming';
            case '/ready':
                return 'Ready';
        }
    }
    let title = changeTitle()
    return(
        <div className= "topbar">
            <h1>Burguer Queen / {title} </h1>
        </div>
    )
}

export default Navbar
